import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract KeyToMetaverseBSC is
    ERC721,
    ERC721Enumerable,
    ERC721URIStorage,
    Pausable,
    ERC721Burnable,
    Ownable,
    AccessControl
{
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant BURNER_ROLE = keccak256("BURNER_ROLE");

    uint256 private tokenIdTracker = 1;

    // NFT list
    string[] public nftList;

    // NFT status
    mapping(string => bool) nftExists;

    // NFT word.
    string[] public nftWords;

    // Max token can be minted.
    uint256 public constant MAX_SUPPLY = 4000;

    string public baseTokenURI;

    // Event
    event welcomeToK2M(uint256 indexed id);

    constructor(
        string memory name,
        string memory symbol,
        address ownerAddress
    ) ERC721(name, symbol) {
        _setupRole(MINTER_ROLE, msg.sender);
        _setupRole(BURNER_ROLE, msg.sender);
        transferOwnership(ownerAddress);
        _setupRole(DEFAULT_ADMIN_ROLE, ownerAddress);
        _setupRole(MINTER_ROLE, ownerAddress);
        _setupRole(BURNER_ROLE, ownerAddress);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenURI;
    }

    function setBaseURI(string memory baseURI) public onlyOwner {
        baseTokenURI = baseURI;
    }

    function grandMinterRole(address minterAddress) public onlyOwner {
        _setupRole(MINTER_ROLE, minterAddress);
    }

    function grandBurnerRole(address burnerAddress) public onlyOwner {
        _setupRole(BURNER_ROLE, burnerAddress);
    }

    function revokeMinterAccess(address minterAddress) public onlyOwner {
        require(
            hasRole(MINTER_ROLE, minterAddress),
            "Couldn't find this address in the roles. "
        );
        revokeRole(MINTER_ROLE, minterAddress);
    }

    function revokeBurnerAccess(address burnerAddress) public onlyOwner {
        require(
            hasRole(BURNER_ROLE, burnerAddress),
            "Couldn't find this address in the roles. "
        );
        revokeRole(BURNER_ROLE, burnerAddress);
    }

    function grandRole(string memory role, address account) public onlyOwner {
        bytes32 roleName = keccak256(abi.encodePacked(role));
        _setupRole(roleName, account);
    }

    function revokeAccess(string memory role, address account)
        public
        onlyOwner
    {
        bytes32 roleName = keccak256(abi.encodePacked(role));
        require(
            roleName != DEFAULT_ADMIN_ROLE,
            "ModifiedAccessControl: cannot revoke default admin role"
        );
        require(
            hasRole(roleName, account),
            "Couldn't find this address in the roles. "
        );
        revokeRole(roleName, account);
    }

    function safeMint(
        address _to,
        string memory _tokenURI,
        string memory _nftWord
    ) external onlyRole(MINTER_ROLE) {
        require(totalSupply() < MAX_SUPPLY, "Total supply is ex");
        require(!nftExists[_tokenURI]);
        nftList.push(_tokenURI);
        // uint256 tokenId = tokenIdTracker.current();
        uint256 tokenId = tokenIdTracker;
        _safeMint(_to, tokenId);
        // tokenIdTracker.increment();
        tokenIdTracker = tokenIdTracker + 1;
        nftExists[_tokenURI] = true;

        // setting the token tokenURI
        _setTokenURI(tokenId, _tokenURI);
        nftWords.push(_nftWord);

        emit welcomeToK2M(tokenId);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override(ERC721, ERC721Enumerable) whenNotPaused {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function burnToken(uint256 tokenId) public onlyOwner {
        _burn(tokenId);
    }

    // The following functions are overrides required by Solidity.

    function _burn(uint256 tokenId)
        internal
        override(ERC721, ERC721URIStorage)
        onlyOwner
    {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
